import React from 'react';

const Navbar = () => {
    return (
        <nav className="nav">
        <div>
          <a href="#">Profile</a>
        </div>
        <div>
          Profile
        </div>
        <div>
          News
        </div>
        <div>
          Music
        </div>
        <div>
          Settings  
        </div>
      </nav>
    );
}

export default Navbar;
